import styled from 'styled-components';
import popeImage from '../assets/imgs/pope.png';

export const Header = styled.header`
  height: 70%;
  width: 100%;
  `;

export const StyledHeaderImage = styled.img`
  background-image: url(${popeImage});
  
width: 100%;
  height: 100%;
`;
